Node.js Mongoose replace order of passed arguments in findeOne() callback<p>I want to use Mongoose in order to save my passport oAuth record to database or ignore it when it's already there. However my then() callback function switch the order of passed arguments and puts results of the query instead of error.</p>

<pre><code>passport.use(new GoogleStrategy({
    clientID: confKeys.googleAuth.client_id,
    clientSecret: confKeys.googleAuth.client_secret,
    callbackURL: confKeys.googleAuth.redirect_uris[0]
  },(accessToken, refreshToken, profile, done) =&gt; {
        User.findOne({ googleID: profile.id }).then((err, existingUser) =&gt; {
            console.log(existingUser) // here I get undefined even if user exists in database
            console.log(err)// here I get data for the user
            if(existingUser){
                done(err, existingUser);
            }else{
                console.log('new user');
                new User({googleID: profile.id}).save()
                .then((err,user) =&gt; done(err, user));
            };
        });
  }
));
</code></pre>

<p>In documentation error argument should be first and result of the query second. I cannot just change names for arguments and get over since passport would give me a promise error. How can I fix this bug? </p>

