What is the difference between a changeStream and tailable cursor in MongoDB<p>I am trying to determine what the difference is between a changestream:
<a href="https://docs.mongodb.com/manual/changeStreams" rel="noreferrer">https://docs.mongodb.com/manual/changeStreams</a>
<a href="https://docs.mongodb.com/manual/reference/method/db.collection.watch/" rel="noreferrer">https://docs.mongodb.com/manual/reference/method/db.collection.watch/</a></p>

<p>which looks like so:</p>

<pre><code>const changeStream = collection.watch();
changeStream.next(function(err, next) {
  expect(err).to.equal(null);
  client.close();
  done();
});
</code></pre>

<p>and a tailable cursor:
<a href="https://docs.mongodb.com/manual/core/tailable-cursors/" rel="noreferrer">https://docs.mongodb.com/manual/core/tailable-cursors/</a></p>

<p>which looks like so:</p>

<pre><code> const cursor = coll.find(self.query || query)
  .addCursorFlag('tailable', true)
  .addCursorFlag('awaitData', true)  // true or false?
  .addCursorFlag('noCursorTimeout', true)
  .addCursorFlag('oplogReplay', true)
  .setCursorOption('numberOfRetries', Number.MAX_VALUE)
  .setCursorOption('tailableRetryInterval', 200);


 const strm = cursor.stream();   // Node.js transform stream
</code></pre>

<p>do they have a different use case? when would it be good to use one over the other?</p>

