mongoose retrieve one document of each type<p>I have an array of <code>batchId</code>s, say <code>[001, 002,003,...]</code>. Also imagine that my collection is like so:</p>

<pre><code>{ batchId: 001, data: ... }
{ batchId: 001, data: ... }
{ batchId: 001, data: ... }
{ batchId: 002, data: ... }
{ batchId: 002, data: ... }
{ batchId: 003, data: ... }
{ batchId: 003, data: ... }
{ batchId: 003, data: ... }
</code></pre>

<p>Now, can I get first one document each of one <code>batchId</code>, so that the response is like this:</p>

<pre><code>{ batchId: 001, data: ... }
{ batchId: 002, data: ... }
{ batchId: 003, data: ... }
</code></pre>

<p>I went through <a href="https://stackoverflow.com/questions/32131604/select-one-of-each-type-from-collection">Select one of each type from collection</a> and the suggested answer was do <code>findOne</code> for each <code>batchId</code>. But is there any way I could do it in a single database fetch ?</p>

<p>NOTE: What I have done now is read everything, and then use Lodash' <code>_.uniqBy</code> to filter one each. Just needed to know if that is the only way.</p>

